style.css:
/* Custom scrollbar for ChatGPT */
::-webkit-scrollbar {
    width: 20px; /* 調整寬度 */
}

::-webkit-scrollbar-track {
    background: #f1f1f1; /* 滾動條軌道顏色 */
}

::-webkit-scrollbar-thumb {
    background: #888; /* 滾動條顏色 */
    border-radius: 10px; /* 圓角 */
}

::-webkit-scrollbar-thumb:hover {
    background: #555; /* 滾動條懸停顏色 */
}
